import React, { Component } from "react";
import { Link } from 'react-router-dom';
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../store';

class MyCartPage extends Component {
    render() {
        // if ((!this.props.is_login) && (this.props.userStatus !== "pembeli")) {
        //     this.props.history.push('/')
        // }

        return (
            <div class="container my-5">
                <div class="row">
                    <div class='col-12 col-md-9'>
                        <div class="card">
                            <table class="table table-hover shopping-cart-wrap">
                                <thead class="text-muted">
                                    <tr>
                                        <th scope="col" width="120">Product</th>
                                        <th scope="col" width="120">Quantity</th>
                                        <th scope="col" width="120">Price</th>
                                        <th scope="col" width="200" class="text-right">Action</th>
                                    </tr>
                                </thead>
                                <tbody>



                                </tbody>
                            </table>
                        </div>
                    </div>
                    <div class="col-md-3 col-12">
                        <dl class="row p-2 pt-3">

                            <dt class="col-sm-6">Total Payment</dt>
                            <dd class="col-sm-6">Rp </dd>

                        </dl>
                        <hr/>

                    </div>
                </div>
            </div>
        );
    }
}

export default connect('is_login, userStatus', actions)
    (withRouter(MyCartPage));
